import React from "react";

const Checkboxes = () => {
  return (
    <div>
      <label htmlFor="Hei">Hei</label>
      <input type="checkbox" name="Hei" />
      Hei&nbsp;
      <input type="checkbox" name="Dude" />
      Dude
    </div>
  );
};

export default Checkboxes;
